) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci; 

CREATE TABLE `vat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
